import Header from "../../compoments/Layout/header";
import Footer from "../../compoments/Layout/footer";
import HomeSection from "../../compoments/HomeBody/homeBanner";
import Thumbnail from "../../compoments/HomeBody/thumbnail";
import "./home.css";
import logements from "../../datas/datas.json";


function Home() {
  return (
    <div className="home">
      <Header />
      <HomeSection /> 
    <div className="thumbnail">
      {logements.map(({ cover, title, index}) => (
        <Thumbnail 
        key={`${title}-${index}`}  
        cover={cover}
        title={title}
      />
    ))}
    </div>
      <Footer />
    </div>
  );
}

export default Home;
